+ (void)drawTaskIconAdd
{
    //// General Declarations
    CGContextRef context = UIGraphicsGetCurrentContext();

    //// Bezier 2 Drawing
    CGContextSaveGState(context);
    CGContextTranslateCTM(context, 1.51, 7.52);
    CGContextRotateCTM(context, -90 * M_PI / 180);

    UIBezierPath* bezier2Path = UIBezierPath.bezierPath;
    [bezier2Path moveToPoint: CGPointMake(0.02, -0.01)];
    [bezier2Path addLineToPoint: CGPointMake(0.02, 11.99)];
    bezier2Path.lineCapStyle = kCGLineCapRound;

    [GLTheme.textColorLabel setStroke];
    bezier2Path.lineWidth = 1;
    [bezier2Path stroke];

    CGContextRestoreGState(context);


    //// Bezier Drawing
    UIBezierPath* bezierPath = UIBezierPath.bezierPath;
    [bezierPath moveToPoint: CGPointMake(7.51, 1.52)];
    [bezierPath addLineToPoint: CGPointMake(7.5, 13.5)];
    bezierPath.lineCapStyle = kCGLineCapRound;

    [GLTheme.textColorLabel setStroke];
    bezierPath.lineWidth = 1;
    [bezierPath stroke];
}

